import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
  state = {};
  render() {
    return (
      <div className="container">
        <div class="card">
          <div class="card-body">
            <Link className="nav-item nav-link" to="/searchRide">
              Need a Ride
            </Link>
          </div>
        </div>
        <div class="card">
          <div class="card-body">
            <Link className="nav-item nav-link" to="/offerRide">
              Offer a Ride
            </Link>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
